  display: inline-grid;
  width: 75px;
  height: 75px;
  background-color: #ededed;
  justify-content: center;
`;
export const Money = styled.div``;

export const LoanItem = styled.div`
  display: flex;
  align-items: center;
  box-shadow: 0px 0px 1px 1px rgb(128 128 128 / 20%);
